4. Zwart-wit foto van een foto van Isaac Israels en Ed. Karsten in het atelier van Jacobus van Looy genomen door Willem Witsen ; 
5. Zwart-wit foto, zelfportret,  van Willem Witsen. In zijn handen houdt hij schilderspullen en een sigaret, naast hem staat een hond ; 
6. Zwart-wit fotoportret van Willem Kloos zittend in een stoel met leunend tegen hem aan zijn wandelstok en in zijn rechterhand een sigaret, gemaakt door Willem Witsen ; 
7. Foto van het portretschilderij van Frederick van Eeden door Jacobus van Looy ; 
8. foto van de Binnenplaats Weeshuis, detail van het schilderij van Jacobus van Looy ; 
9. Foto van Huis van Looy; 
10. Reproductie van een foto van de gevel van het geboortehuis van Jacobus van Looy. In het bezit van de gemeentearchief Haarlem ;
11. Reproductie van een foto van Eduard Verkade (1878-1961) verkleed als Macbeth in 1904. Het is een foto met sterke licht-donker contrasten ;
12. Reproductie van een foto met o.a. P.L. Tak, Antoon Derkinderen, Jan Veth en R.N. Roland Holst op de stoep van Veth's woning te Bussum ;
13. Reproductie van een foto met Jacobus van Looy en Titia van Gelder ter gelegenheid van hun verloving ;
14. Reproductie van een foto met Jacobus van Looy en zijn zusters Kee en Jansje in de kleding van het Gereformeerde Burgerweeshuis te Haarlem ;
15. Kleurenfoto en de zwart-wit kopie (vergroot) van deze foto van het schilderij 'Elia op de berg Karmel' ; 
